(47,1,2,1,1,3,'Where did Joseph and Mary escape when Herod was trying to kill Jesus?','Matthew 2:13',3,'2022-07-18 00:01:51',NULL),
(48,1,2,1,1,4,'Where was Jesus baptized?','Matthew 3:16',3,'2022-07-18 00:04:16',NULL),
